                "description": "In a series of personal essays, prominent journalist and LGBTQIA+ activist George M. Johnson explores his childhood, adolescence, and college years in New Jersey and Virginia. From the memories of getting his teeth kicked out by bullies at age five, to flea marketing with his loving grandmother, to his first sexual relationships, this young-adult memoir weaves together the trials and triumphs faced by Black queer boys.    Both a primer for teens eager to be allies as well as a reassuring testimony for young queer men of color, &lt;em&gt;All Boys Aren&#039;t Blue &lt;/em&gt;covers topics such as gender identity, toxic masculinity, brotherhood, family, structural marginalization, consent, and Black joy. Johnson&#039;s emotionally frank style of writing will appeal directly to young adults.    &lt;a href=&quot;https://pgcmls.overdrive.com/search?query=all+boys+aren%27t+blue&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;Borrow &lt;em&gt;All Boys Aren&#039;t Blue &lt;/em&gt;from PGCMLS&lt;/a&gt;    &lt;a href=&quot;https://www.eastcitybookshop.com/book/9780374312718&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;Purchase a copy through East City Bookshop&lt;/a&gt;    &lt;strong&gt;George M. Johnson&lt;/strong&gt; is a writer and activist based in New York. He has written on race, gender, sex, and culture for &lt;em&gt;Essence&lt;/em&gt;, The Advocate, &lt;em&gt;Buzz Feed News, Teen Vogue&lt;/em&gt;, and more than forty other national publications. He is a columnist for AFROPUNK, and has appeared on BuzzFeed&#039;s AM2DM as well as MSNBC. &lt;em&gt;All Boys Aren&#039;t Blue&lt;/em&gt; is his debut.    Presented by the Prince George&#039;s County Memorial Library System, in association with Anne Arundel County Public Library, Calvert Library, Carroll County Public Library, and Howard County Public Library.",
